// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

library SafeMath {
  function add(uint256 a, uint256 b) internal pure returns (uint256) {
    return a + b;
  }

  function sub(uint256 a, uint256 b) internal pure returns (uint256) {
    return a - b;
  }

  function mul(uint256 a, uint256 b) internal pure returns (uint256) {
    return a * b;
  }

  function div(uint256 a, uint256 b) internal pure returns (uint256) {
    return a / b;
  }

  function sub(uint256 a, uint256 b, string memory errorMessage) internal pure returns (uint256) {
    unchecked {
      require(b <= a, errorMessage);
      return a - b;
    }
  }

  function div(uint256 a, uint256 b, string memory errorMessage) internal pure returns (uint256) {
    unchecked {
      require(b > 0, errorMessage);
      return a / b;
    }
  }
}

interface AggregatorV3Interface {
  function decimals() external view returns (uint8);
  function description() external view returns (string memory);
  function version() external view returns (uint256);
  function getRoundData(
    uint80 _roundId
  ) external view returns (uint80 roundId, int256 answer, uint256 startedAt, uint256 updatedAt, uint80 answeredInRound);
  function latestRoundData()
    external
    view
    returns (uint80 roundId, int256 answer, uint256 startedAt, uint256 updatedAt, uint80 answeredInRound);
}

interface IERC20 {
  event Transfer(address indexed from, address indexed to, uint256 value);
  event Approval(address indexed owner, address indexed spender, uint256 value);

  function totalSupply() external view returns (uint256);
  function balanceOf(address account) external view returns (uint256);
  function transfer(address to, uint256 value) external returns (bool);
  function allowance(address owner, address spender) external view returns (uint256);
  function approve(address spender, uint256 value) external returns (bool);
  function transferFrom(address from, address to, uint256 value) external returns (bool);
}

abstract contract DateTime {
  uint256 constant SECONDS_PER_DAY = 24 * 60 * 60;
  int constant OFFSET19700101 = 2440588;

  function timestampFromDate(uint256 year, uint256 month, uint256 day) internal pure returns (uint256 timestamp) {
    timestamp = daysFromDate(year, month, day) * SECONDS_PER_DAY;
  }

  function getYear(uint256 timestamp) internal pure returns (uint256 year) {
    (year, , ) = daysToDate(timestamp / SECONDS_PER_DAY);
  }

  function getMonth(uint256 timestamp) internal pure returns (uint256 month) {
    (, month, ) = daysToDate(timestamp / SECONDS_PER_DAY);
  }

  function getDay(uint256 timestamp) internal pure returns (uint256 day) {
    (, , day) = daysToDate(timestamp / SECONDS_PER_DAY);
  }

  function daysFromDate(uint256 year, uint256 month, uint256 day) internal pure returns (uint256 _days) {
    require(year >= 1970);
    int _year = int(year);
    int _month = int(month);
    int _day = int(day);

    int __days = _day -
      32075 +
      (1461 * (_year + 4800 + (_month - 14) / 12)) /
      4 +
      (367 * (_month - 2 - ((_month - 14) / 12) * 12)) /
      12 -
      (3 * ((_year + 4900 + (_month - 14) / 12) / 100)) /
      4 -
      OFFSET19700101;

    _days = uint256(__days);
  }

  function daysToDate(uint256 _days) internal pure returns (uint256 year, uint256 month, uint256 day) {
    int __days = int(_days);

    int L = __days + 68569 + OFFSET19700101;
    int N = (4 * L) / 146097;
    L = L - (146097 * N + 3) / 4;
    int _year = (4000 * (L + 1)) / 1461001;
    L = L - (1461 * _year) / 4 + 31;
    int _month = (80 * L) / 2447;
    int _day = L - (2447 * _month) / 80;
    L = _month / 11;
    _month = _month + 2 - 12 * L;
    _year = 100 * (N - 49) + _year + L;

    year = uint256(_year);
    month = uint256(_month);
    day = uint256(_day);
  }
}

abstract contract Context {
  function _msgSender() internal view virtual returns (address) {
    return msg.sender;
  }

  function _msgData() internal view virtual returns (bytes calldata) {
    return msg.data;
  }

  function _contextSuffixLength() internal view virtual returns (uint256) {
    return 0;
  }
}

abstract contract Pausable is Context {
  bool private _paused;

  event Paused(address account);
  event Unpaused(address account);

  error EnforcedPause();
  error ExpectedPause();

  constructor() {
    _paused = false;
  }

  modifier whenNotPaused() {
    _requireNotPaused();
    _;
  }

  modifier whenPaused() {
    _requirePaused();
    _;
  }

  function paused() public view virtual returns (bool) {
    return _paused;
  }

  function _requireNotPaused() internal view virtual {
    if (paused()) {
      revert EnforcedPause();
    }
  }

  function _requirePaused() internal view virtual {
    if (!paused()) {
      revert ExpectedPause();
    }
  }

  function _pause() internal virtual whenNotPaused {
    _paused = true;
    emit Paused(_msgSender());
  }

  function _unpause() internal virtual whenPaused {
    _paused = false;
    emit Unpaused(_msgSender());
  }
}

abstract contract Ownable is Context {
  address private _owner;

  error OwnableUnauthorizedAccount(address account);
  error OwnableInvalidOwner(address owner);

  event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

  constructor(address initialOwner) {
    if (initialOwner == address(0)) {
      revert OwnableInvalidOwner(address(0));
    }
    _transferOwnership(initialOwner);
  }

  modifier onlyOwner() {
    _checkOwner();
    _;
  }

  function owner() public view virtual returns (address) {
    return _owner;
  }

  function _checkOwner() internal view virtual {
    if (owner() != _msgSender()) {
      revert OwnableUnauthorizedAccount(_msgSender());
    }
  }

  function renounceOwnership() public virtual onlyOwner {
    _transferOwnership(address(0));
  }

  function transferOwnership(address newOwner) public virtual onlyOwner {
    if (newOwner == address(0)) {
      revert OwnableInvalidOwner(address(0));
    }
    _transferOwnership(newOwner);
  }

  function _transferOwnership(address newOwner) internal virtual {
    address oldOwner = _owner;
    _owner = newOwner;
    emit OwnershipTransferred(oldOwner, newOwner);
  }
}

contract ShineGameFiBscPresale is Ownable, Pausable, DateTime {
  using SafeMath for uint256;

  address payable public immutable admin;

  IERC20 public token;
  IERC20 public usdt;

  AggregatorV3Interface internal priceFeed;

  uint256 public tokenPerUSDT = 16667 * 1e16;
  uint256 public minimumPurchaseUSDT = 20 * 1e18;

  uint256 public claimDay = 10;
  uint256 public firstStageClaimDate;
  uint256 public secondStageClaimDate;

  uint256 public maxClaims = 9;
  uint256 public initialReleasePercentage = 20;
  uint256 public totalBalanceTokensStored = 0;

  bool public isOpenClaim = false;

  mapping(address => uint256) public firstStagebalances;
  mapping(address => uint256) public secondStagebalances;

  mapping(address => uint256) public buyerClaims;
  mapping(address => uint256) public lastClaimTime;

  event TokensPerEtherPurchased(address indexed buyer, uint256 etherAmount, uint256 tokenAmount);
  event TokensPerUSDTPurchased(address indexed buyer, uint256 usdtAmount, uint256 tokenAmount);
  event TokensClaimed(address indexed buyer, uint256 amountClaimed);

  constructor(address _admin, address _usdt, address _token, address _chainlink) Ownable(_msgSender()) {
    admin = payable(_admin);
    token = IERC20(_token);
    usdt = IERC20(_usdt);
    priceFeed = AggregatorV3Interface(_chainlink);
  }

  receive() external payable {}

  function buyTokensByEther() external payable whenNotPaused {
    uint256 usdtAmount = etherToUSDT(msg.value);
    require(usdtAmount >= minimumPurchaseUSDT, "Minimum purchase amount not met");

    uint256 tokenAmount = usdtToToken(usdtAmount);

    require(
      tokenBalanceAvailableForPurchase() >= tokenAmount,
      "Presale Balance contract has not enough tokens in its balance"
    );

    uint256 tokensFirstStage = tokenAmount.mul(initialReleasePercentage).div(100);
    uint256 tokensSecondStage = tokenAmount.sub(tokensFirstStage);

    firstStagebalances[_msgSender()] = firstStagebalances[_msgSender()].add(tokensFirstStage);
    secondStagebalances[_msgSender()] = secondStagebalances[_msgSender()].add(tokensSecondStage);

    totalBalanceTokensStored += tokenAmount;
    admin.transfer(msg.value);

    emit TokensPerEtherPurchased(_msgSender(), msg.value, tokenAmount);
  }

  function buyTokensByUSDT(uint256 _usdtAmount) external whenNotPaused {
    require(_usdtAmount >= minimumPurchaseUSDT, "Minimum purchase amount not met");
    uint256 tokenAmount = usdtToToken(_usdtAmount);

    require(
      tokenBalanceAvailableForPurchase() >= tokenAmount,
      "Presale Balance contract has not enough tokens in its balance"
    );

    require(usdt.transferFrom(_msgSender(), admin, _usdtAmount), "Payment not received");

    uint256 tokensFirstStage = tokenAmount.mul(initialReleasePercentage).div(100);
    uint256 tokensSecondStage = tokenAmount.sub(tokensFirstStage);

    firstStagebalances[_msgSender()] = firstStagebalances[_msgSender()].add(tokensFirstStage);
    secondStagebalances[_msgSender()] = secondStagebalances[_msgSender()].add(tokensSecondStage);

    totalBalanceTokensStored += tokenAmount;

    emit TokensPerUSDTPurchased(_msgSender(), _usdtAmount, tokenAmount);
  }

  function claimFirstStage() external whenNotPaused {
    require(block.timestamp >= firstStageClaimDate, "You still cannot claim the tokens");

    uint256 amountToClaim = firstStagebalances[_msgSender()];

    token.transfer(_msgSender(), amountToClaim);
    totalBalanceTokensStored = totalBalanceTokensStored.sub(amountToClaim);

    firstStagebalances[_msgSender()] = 0;

    emit TokensClaimed(_msgSender(), amountToClaim);
  }

  function claim() external whenNotPaused {
    require(block.timestamp >= secondStageClaimDate, "You still cannot claim the tokens");
    require(getDay(block.timestamp) >= claimDay, "You cannot claim tokens this month yet");
    require(lastClaimTime[_msgSender()] < startOfMonth(block.timestamp), "Tokens already claimed for this month");

    uint256 amountToClaim = calculateClaimableAmount(_msgSender());

    lastClaimTime[_msgSender()] = block.timestamp;
    require(token.transfer(_msgSender(), amountToClaim), "Failed to transfer tokens to user");

    secondStagebalances[_msgSender()] = secondStagebalances[_msgSender()].sub(amountToClaim);
    totalBalanceTokensStored = totalBalanceTokensStored.sub(amountToClaim);

    buyerClaims[_msgSender()] += 1;

    emit TokensClaimed(_msgSender(), amountToClaim);
  }

  function openClaim(uint256 _amount) external whenNotPaused {
    require(isOpenClaim == true, "open claim is disabled");
    require(secondStagebalances[_msgSender()] >= _amount, "No tokens available for claim");
    require(token.transfer(_msgSender(), _amount), "Failed to transfer tokens to user");

    secondStagebalances[_msgSender()] = secondStagebalances[_msgSender()].sub(_amount);
    totalBalanceTokensStored = totalBalanceTokensStored.sub(_amount);

    emit TokensClaimed(_msgSender(), _amount);
  }

  function calculateClaimableAmount(address _account) public view returns (uint256) {
    require(secondStagebalances[_account] > 0, "No tokens available for claim");

    uint256 totalTokensStored = secondStagebalances[_account];
    uint256 numAvailableClaims = maxClaims - buyerClaims[_account];
    uint256 claimableAmount = totalTokensStored.div(numAvailableClaims);

    return claimableAmount;
  }

  function startOfMonth(uint256 timestamp) public pure returns (uint256) {
    uint year = getYear(timestamp);
    uint month = getMonth(timestamp);

    return timestampFromDate(year, month, 1);
  }

  function tokenBalanceAvailableForPurchase() public view returns (uint256) {
    uint256 tokenBalance = token.balanceOf(address(this));
    uint256 tokensAvailable = tokenBalance.sub(totalBalanceTokensStored);

    return tokensAvailable;
  }

  function etherToUSDT(uint256 _etherAmount) public view returns (uint256) {
    uint256 numberOfUSDTs = (_etherAmount * getLatestPrice()) / (10 ** priceFeed.decimals());
    return numberOfUSDTs;
  }

  function usdtToToken(uint256 _usdtAmount) public view returns (uint256) {
    uint256 numberOfTokens = (_usdtAmount * (tokenPerUSDT)) / (1e18);
    return numberOfTokens;
  }

  function getLatestPrice() public view returns (uint256) {
    (, int256 price, , , ) = priceFeed.latestRoundData();
    return uint256(price);
  }

  function changeTokenAddress(IERC20 _token) external onlyOwner {
    token = _token;
  }

  function changeUSDTAddress(IERC20 _usdt) external onlyOwner {
    usdt = _usdt;
  }

  function changeChainlink(address _chainlink) external onlyOwner {
    priceFeed = AggregatorV3Interface(_chainlink);
  }

  function changePrice(uint256 _price) external onlyOwner {
    tokenPerUSDT = _price;
  }

  function changeMinimumPurchaseUSDT(uint256 _minimumPurchaseUSDT) external onlyOwner {
    minimumPurchaseUSDT = _minimumPurchaseUSDT;
  }

  function changeClaimDay(uint256 _claimDay) external onlyOwner {
    claimDay = _claimDay;
  }

  function changeFirstStageClaimDate(uint256 _firstStageClaimDate) external onlyOwner {
    firstStageClaimDate = _firstStageClaimDate;
  }

  function changeSecondStageClaimDate(uint256 _secondStageClaimDate) external onlyOwner {
    secondStageClaimDate = _secondStageClaimDate;
  }

  function changeInitialReleasePercentage(uint256 _initialReleasePercentage) external onlyOwner {
    initialReleasePercentage = _initialReleasePercentage;
  }

  function changeMaxClaims(uint256 _maxClaims) external onlyOwner {
    maxClaims = _maxClaims;
  }

  function setIsOpenClaim(bool _isOpenClaim) external onlyOwner {
    isOpenClaim = _isOpenClaim;
  }

  function transferFundsTokens(uint256 _amount) external onlyOwner {
    require(_amount <= tokenBalanceAvailableForPurchase(), "Insufficient token balance");
    token.transfer(admin, _amount);
  }

  function contractBalanceTokens() external view returns (uint256) {
    return token.balanceOf(address(this));
  }

  function pause() external onlyOwner {
    _pause();
  }

  function unpause() external onlyOwner {
    _unpause();
  }
}
